import React, { Component } from 'react'
import { Row, Col, Modal, Input, Button, Select, message, Table } from 'antd';

const columns = [
    {
        title: 'Date',
        dataIndex: 'date',
    },
    {
        title: 'Debit / Credit',
        dataIndex: 'debcre',
    },
    {
        title: 'Description',
        dataIndex: 'description',
        sorter: (a, b) => a.age - b.age,
    },
    {
        title: 'Category',
        dataIndex: 'category',
    },
    {
        title: 'Account',
        dataIndex: 'account_type',
    },
    {
        title: 'Transcation Type',
        dataIndex: 'transcation_type',
    },
]

const data =[
    {
        date: 'Jan 20',
        debcre: 'DEBIT',
        description: 'Hello world',
        category: "FOOD",
        account_type: "cash_account",
        transcation_type: 'UPI Transfer'
    },
    {
        date: 'Jan 20',
        debcre: 'DEBIT',
        description: 'Hello world',
        category: "FOOD",
        account_type: "cash_account",
        transcation_type: 'UPI Transfer'
    },
    {
        date: 'Jan 20',
        debcre: 'DEBIT',
        description: 'Hello world',
        category: "FOOD",
        account_type: "cash_account",
        transcation_type: 'UPI Transfer'
    },
    {
        date: 'Jan 20',
        debcre: 'DEBIT',
        description: 'Hello world',
        category: "FOOD",
        account_type: "cash_account",
        transcation_type: 'UPI Transfer'
    },
    {
        date: 'Jan 20',
        debcre: 'DEBIT',
        description: 'Hello world',
        category: "FOOD",
        account_type: "cash_account",
        transcation_type: 'UPI Transfer'
    },
    {
        date: 'Jan 20',
        debcre: 'DEBIT',
        description: 'Hello world',
        category: "FOOD",
        account_type: "cash_account",
        transcation_type: 'UPI Transfer'
    },
    {
        date: 'Jan 20',
        debcre: 'DEBIT',
        description: 'Hello world',
        category: "FOOD",
        account_type: "cash_account",
        transcation_type: 'UPI Transfer'
    },
    {
        date: 'Jan 20',
        debcre: 'DEBIT',
        description: 'Hello world',
        category: "FOOD",
        account_type: "cash_account",
        transcation_type: 'UPI Transfer'
    },
]

export class Transcation extends Component {
    state = {
        searchText: '',
        searchedColumn: '',
      };

    getColumnSearchProps = dataIndex => ({
        filterDropdown: ({ setSelectedKeys, selectedKeys, confirm, clearFilters }) => (
          <div style={{ padding: 8 }}>
            <Input
              ref={node => {
                this.searchInput = node;
              }}
              placeholder={`Search ${dataIndex}`}
              value={selectedKeys[0]}
              onChange={e => setSelectedKeys(e.target.value ? [e.target.value] : [])}
              onPressEnter={() => this.handleSearch(selectedKeys, confirm, dataIndex)}
              style={{ width: 188, marginBottom: 8, display: 'block' }}
            />
            <Space>
              <Button
                type="primary"
                onClick={() => this.handleSearch(selectedKeys, confirm, dataIndex)}
                icon={<SearchOutlined />}
                size="small"
                style={{ width: 90 }}
              >
                Search
              </Button>
              <Button onClick={() => this.handleReset(clearFilters)} size="small" style={{ width: 90 }}>
                Reset
              </Button>
            </Space>
          </div>
        ),
        filterIcon: filtered => <SearchOutlined style={{ color: filtered ? '#1890ff' : undefined }} />,
        onFilter: (value, record) =>
          record[dataIndex]
            ? record[dataIndex].toString().toLowerCase().includes(value.toLowerCase())
            : '',
        onFilterDropdownVisibleChange: visible => {
          if (visible) {
            setTimeout(() => this.searchInput.select(), 100);
          }
        },
        render: text =>
          this.state.searchedColumn === dataIndex ? (
            <Highlighter
              highlightStyle={{ backgroundColor: '#ffc069', padding: 0 }}
              searchWords={[this.state.searchText]}
              autoEscape
              textToHighlight={text ? text.toString() : ''}
            />
          ) : (
            text
          ),
      });
    render() {
        return (
          <div className="container-fluid">
            <Row>
                <Col span={12}>
                    {/* BreadCrumps */}
                    <div className="row">
                        <div className="col-lg-6">
                            <div className="page-title-box">
                                <div className="row">
                                    <div className="col">
                                        <h4 className="page-title">Transcations</h4>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </div>
                </Col>
                <Col span={12}>
                    <Button type="primary" style={{ float: 'right', marginRight: '100px' }}>Add a Transcation</Button>
                </Col>
            </Row>
            <div style={{ padding: '50px' }}>
                <Table style={{ marginTop: '70px' }} columns={columns} dataSource={data}/>
            </div>
          </div>
        )
    }

}

export default  Transcation;
